INSERT INTO `menu_custom` (`menu_name`, `title`, `description`) VALUES
('navigation', 'Navegación', 'El menú de navegación es proporcionado por Drupal y es el principal menú interactivo para cualquier sitio. Normalmente es el único menú que contiene enlaces personalizados para usuarios autenticados y a menudo no es visible para usuarios anónimos.'),
('primary-links', 'Enlaces primarios', 'Los enlaces primarios se utilizan con frecuencia en el tema para mostrar las principales secciones de un sitio web. Una típica representación de los principales enlaces son las pestañas en la parte superior.'),
('secondary-links', 'Enlaces secundarios', 'Los enlaces secundarios se utilizan normalmente para páginas como información legal, noticias, contacto, detalles y otros elementos de navegación secundaria, no tan importantes como los enlaces primarios.');
