INSERT INTO `node_type` (`type`, `name`, `module`, `description`, `help`, `has_title`, `title_label`, `has_body`, `body_label`, `min_word_count`, `custom`, `modified`, `locked`, `orig_type`) VALUES
('page', 'Página', 'node', 'Una <em>página<em>, similar en forma y contenido a un <em>artículo</em>, es un método sencillo de crear y mostrar información que no suele cambiar, como una sección "Acerca de" en un sitio web. Por defecto, una <em>página</em> no permite comentarios de visitantes y no es promovida a la portada del sitio.', '', 1, 'Título', 1, 'Cuerpo', 0, 1, 1, 0, 'page'),
('story', 'Artículo', 'node', 'Un <em>artículo</em>, con estructura similar a una <em>página</em>, es ideal para crear y mostrar contenido que informa a los visitantes del sitio. Notas de prensa, anuncios del sitio, y entradas informales de un blog pueden ser creadas con un <em>artículo</em>. Por defecto, un <em>artículo</em> aparece automáticamente en la página inicial del sitio, y permite recibir comentarios.', '', 1, 'Título', 1, 'Cuerpo', 0, 1, 1, 0, 'story');
