(118, 1, 'i18nstrings', 'Created string %location for text group %textgroup: %string', 'a:3:{s:9:"%location";s:15:"type:story:body";s:10:"%textgroup";s:8:"nodetype";s:7:"%string";s:6:"Cuerpo";}', 5, '', 'http://127.0.0.1/Web/?q=admin/build/modules/list/confirm', 'http://127.0.0.1/Web/?q=admin/build/modules/list/confirm', '127.0.0.1', 1282355028),
(119, 1, 'i18nstrings', 'Created string %location for text group %textgroup: %string', 'a:3:{s:9:"%location";s:22:"type:story:description";s:10:"%textgroup";s:8:"nodetype";s:7:"%string";s:389:"Un <em>artículo</em>, con estructura similar a una <em>página</em>, es ideal para crear y mostrar contenido que informa a los visitantes del sitio. Notas de prensa, anuncios del sitio, y entradas informales de un blog pueden ser creadas con un <em>artículo</em>. Por defecto, un <em>artículo</em> aparece automáticamente en la página inicial del sitio, y permite recibir comentarios.";}', 5, '', 'http://127.0.0.1/Web/?q=admin/build/modules/list/confirm', 'http://127.0.0.1/Web/?q=admin/build/modules/list/confirm', '127.0.0.1', 1282355028),
